window.bookSummaryJSON = "<p>A riddle, a game, and a clue in the garden. Don’t miss the thrilling sixth book in the award-winning Accidental Alchemist Mystery series, perfect for fans of cozy mysteries and urban fantasy.</p> <p>When Zoe Faust sees the ghost of a murdered young woman, is it really a spirit—or a flesh and blood woman who stopped aging because she’s a fellow alchemist?</p> <p>Sixteen years ago, high school student Ridley Price discovered a secret she planned to reveal through a party game—but someone killed her first. The baffling crime was never solved. Zoe’s friend Heather has always wondered: Which of the seven guests at the party killed Ridley? When the newly appeared ghost turns dangerous, threatening people they love, Zoe teams up with her gargoyle roommate, Dorian, to unmask the supposed specter.</p>"; 
